      | 363770 -> { ItemTypeData.id= 363770; name= "Assault Rail Rifle"; published= false; description= "Part of Kaalakiota’s Stahl line of weaponry, the rail rifle is a fast-firing precision weapon designed for field operations where penetrative power and range are paramount. Developed using the corporation’s proprietary microscale technology, the rail rifle solves oversaturation issues endemic to sustained fire electromagnetic weaponry.  However, its greater range and power are offset by a smaller magazine capacity and lower rate of fire than similarly classified weapons.    The foregrip design aids stabilization and remains cool to the touch even during prolonged discharge where the barrel can exceed mean operating temperatures. Featuring a reinforced subassembly and compact, heavy-barrel design, the rail rifle is the premier fully automatic microscale weapon available today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
