      | 52303 -> { ItemTypeData.id= 52303; name= "Tengu Emperor Bear SKIN"; published= true; description= "The high lords of the ancient Caldari Raata Empire used many different sigils but one of the most famous is the sign of the Emperor Bear, believed to have been the personal sigil of Emperor K'vire III Fuukiuye of the Second Unification Realm. While the ancient histories of the Caldari are shrouded in myth and legend, this bear sigil is clearly derived from a totemic attachment to the large Emperor Bears of the southern polar archipelagos. The Fuukiuye tribes are thought to have ranged as far south as the island taigas in their remarkable migrations across the face of Caldari Prime, and surely encountered the golden-furred Emperor Bears.    It is likely that a golden bear totem was used by one of the paramount tribes and became associated with leadership over the centuries. Emperor K'vire III Fuukiuye was no doubt concerned to cement his leadership of the Raata Empire by using the symbolism. The sigil was dispensed with some two centuries later when the Fuukiuye emperors were supplanted by the Orioyoni under the leadership of Emperor Deteaas IX Orioyoni during the Third Unification. The Emperor Bear, like its northern Storm Bear cousin, remains a potent symbol for Caldari, indicative in some animist traditions of leadership that serves the collective."; marketGroupId= Some(2370); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52400 -> { ItemTypeData.id= 52400; name= "Scorpion Triglavian Twilight SKIN"; published= true; description= "Commissioned in YC121 by CONCORD's own Kjersidur Elladall of the Directive Enforcement Department, these commemorative SKINs serve as a reminder and a badge of honour for those daring Capsuleers who risked all to say  I was there  when the Triglavian Collective breached the boundaries of Abyssal Deadspace and invaded the systems of New Eden.    In that year across the Empire-owned systems of the cluster, Conduits from Abyssal Deadspace appeared and carried the forces of the Collective into the comparatively rich and utopian star systems that CONCORD and the DED are sworn to protect.    CONCORD will never forget - nor fail to honour - the brave pilots who dedicated their time, their resources and their clones in the fight against the Triglavian menace."; marketGroupId= Some(1965); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
